  byear: { type: String },
  age: { type: String },
</code></pre>

<p>I thought that there is a way that can be used function in the model instantly and calculate age from birth date or convert it inside above function but have no idea how to achieve to that result?
How to get age from those 3 details (bday, bmonth,byear)?</p>

