MongoDB/Mongoose - Adding an object to an array of objects only if a certain field is unique<p>So I have a nested array of objects in my MongoDB document and I would like to add a new object to the array only if a certain field (in this case, eventId) is unique. My question is very similar to <a href="https://stackoverflow.com/questions/33576223/using-mongoose-mongodb-addtoset-functionality-on-array-of-objects">this post</a>, only I cannot seem to get that solution to work in my case.</p>

<p>Here is what the documents (<code>UserModel</code>) look like:</p>

<pre><code>{
  "portal" : {
    "events" : [ 
      {
        "important" : false,
        "completed" : false,
        "_id" : ObjectId("5c0c2a93bb49c91ef8de0b21"),
        "eventId" : "5bec4a7361853025400ee9e9",
        "user_notes" : "My event note"
      },
      ...and so on
    ]
  }
}
</code></pre>

<p>And here is my (so far unsuccessful) Mongoose operation:</p>

<pre><code>UserModel.findByIdAndUpdate(
  userId,
  { "portal.events.eventId": { $ne: req.body.eventId } },
  { $addToSet: { "portal.events": req.body } },
  { new: true }
);
</code></pre>

<p>Basically I am trying to use <code>'$ne'</code> to check if the field is unique, and then <code>'$addToSet'</code> (or <code>'$push'</code>, I believe they are functionally equivalent in this case) to add the new object.</p>

<p>Could anyone point me in the right direction?</p>

<p>Cheers,
Gabe</p>

