Prop I can access in component can't be rendered<p>My MERN app's purpose is to take a 3-digit input from a user and return the first prime number that contains those digits (ex: you enter 026, the app returns 10267). If my <code>checker()</code> function finds a match, I run <code>updatePrimeNumber()</code> to update that prime number's "match" variable to true. Database is updating properly. </p>

<p>I want to display all prime numbers that have "match" equal to true. I have a prop, <code>primeNumbers</code>, which contains all the primes I have entered into the database. I can access those numbers throughout my component, but I can not figure out how to render any of them, true or not. The error I receive is that <code>primeNumbers is not defined</code>.</p>

<pre><code>import React, { Component } from 'react';
import gql from "graphql-tag";
import { graphql, compose } from 'react-apollo';

const PrimeNumbersQuery = gql`
{
  primeNumbers {
    id
    text
    match
  }
}
`;

const UpdateMutuation = gql`
  mutation($id: ID!, $match: Boolean!) {
    updatePrimeNumber(id: $id, match: $match)
  }
`;

class Prime extends Component {
  checker = (primes) =&gt; {
    let nums = this.props.checkedNumbersFromParent;
    let recentChecked = (nums[nums.length - 1].text);
    let recentCheckedRegExp = new RegExp(recentChecked);
    for (var i in primes) {
      let count = 0;
      if (primes[i].text.search(recentCheckedRegExp) &gt;= 0 &amp;&amp; count &lt; 1) {
        this.updatePrimeNumber(primes[i]);
        count = count + 1;
        break;
      }
    }
    return primes;
  }

  updatePrimeNumber = async (primeNumber) =&gt; {
    await this.props.updatePrimeNumber({
      variables: {
        id: primeNumber.id,
        match: primeNumber.match
      },
      update: store =&gt; {
        const data = store.readQuery({ query: PrimeNumbersQuery });
        data.primeNumbers = data.primeNumbers.map(
          x =&gt;
            x.id === primeNumber.id
            ? {
                ...primeNumber, match: true
              }
            : x
        );
        store.writeQuery({ query: PrimeNumbersQuery, data });
      }
    });
  };

  render() {
    const {data: {loading, primeNumbers}} = this.props;
    this.checker(primeNumbers)
    return (
      &lt;div&gt;
      ***Need to render all primeNumbers with match === true***
      &lt;/div&gt;
    );
  }
}

export default compose(
  graphql(UpdateMutuation, {name: 'updatePrimeNumber'}),
  graphql(PrimeNumbersQuery)
)(Prime);
</code></pre>

<p>Thank you to anyone who looks at this. It is much appreciated. </p>

