How to update and insert a document using MongoItemWriter in Spring Batch?<p>In a Spring Batch project involving reading and writing to MongoDB, writing to MongoDB using <code>MongoItemWriter</code> is configured like this:</p>

<pre><code>&lt;batch:job id=someJob&gt;
    &lt;batch:step id="step1"&gt;
        &lt;batch:tasklet&gt;
            &lt;batch:chunk reader=reader
                writer=writer
                processor=processor commit-interval="10" /&gt;
        &lt;/batch:tasklet&gt;
    &lt;/batch:step&gt;
&lt;/batch:job&gt;
</code></pre>

<p>The writer bean is configured like this: </p>

<pre><code>&lt;bean id="writer"
    class="org.springframework.batch.item.data.MongoItemWriter"&gt;
    &lt;property name="template" ref="mongoTemplate" /&gt;
    &lt;property name="collection"
        value="XYZCollection" /&gt;
&lt;/bean&gt;
</code></pre>

<p>Then we have the model:</p>

<pre><code>public class Sample {

    @Id
    private ObjectId id;

    @Field(Field1)
    private String field1;

    @PersistenceConstructor
    public Sample() { }

    // getter and setters

}
</code></pre>

<p>Finally, from the <code>processor</code>, the object of the class whose model makes up the MongoDB document is returned, so that the <code>ItemWriter</code> will pick it up for inserting into the database:</p>

<pre><code>public class Processor implements ItemProcessor&lt;Sample, Sample&gt; {

    @Override
    public Sample process(Sample sampleItem) throws Exception {
        Sample updatedSampleItem = updateSampleItem(sampleItem);
        Sample newSampleItem = createSampleItem(sampleItem);
        return newSampleItem;
    }
}
</code></pre>

<p>Versions used:
- spring-core 5.1.3.RELEASE
- spring-batch 4.1.0.RELEASE
- spring-data-mongodb 2.1.3.RELEASE </p>

<p>Now, this saves the <code>newSampleItem</code> into <code>XYZCollection</code> as it has to. The requirement is to make Spring-Batch update the <code>sampleItem</code> that got read and then create a new document for the <code>newSampleItem</code> object. Is it possible to do so? If yes, how?</p>

